import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M11.27 15.8a.75.75 0 01-1.06-.03l-5-5.25a.75.75 0 010-1.04l5-5.25a.75.75 0 111.08 1.04L6.8 10l4.5 4.73c.29.3.28.78-.02 1.06zm4 0a.75.75 0 01-1.06-.03l-5-5.25a.75.75 0 010-1.04l5-5.25a.75.75 0 111.08 1.04L10.8 10l4.5 4.73c.29.3.28.78-.02 1.06z", fill: primaryFill }));
};
const ChevronDoubleLeft20Filled = wrapIcon(rawSvg({}), 'ChevronDoubleLeft20Filled');
export default ChevronDoubleLeft20Filled;
